function generate_pdf() {
    var doc = new jspdf.jsPDF()
    // this is the contents of the converted HadasimCLM-Regular using jspdf font
    // converter:
    // https://rawgit.com/MrRio/jsPDF/master/fontconverter/fontconverter.html
    var font = '';
    doc.addFileToVFS('assets/HadasimCLM-Regular-normal.ttf', font);
    doc.addFont('assets/HadasimCLM-Regular-normal.ttf', 'HadasimCLM-Regular', 'normal');
    doc.setFont("HadasimCLM-Regular", "normal")
    var rtl_table = $('#vocab').clone()
    // for some reason, jspdf-autotable doesn't respect rtl text. started with
    // this stackoverflow and came up with this solution https://stackoverflow.com/a/60901461
    rtl_table.find('tr').each(function () {
        $(this).children('td.yiddish').each(function(){
            txt = $(this).text()
            $(this).text(txt.split('').reverse().join(''))
        })
    })
    doc.autoTable({html: rtl_table.get()[0],
                   styles: {font: 'HadasimCLM-Regular'}});
    doc.save('derfer-un-drakonen.pdf')
}
